import React from "react";
import "./resume.scss";

const Resume = () => {
  return (
    <div className="resume">
      <div className="top">
        <img src={process.env.PUBLIC_URL + "/images/Profilbild.jpg"} alt="Jakob Persson"/>
      </div>
      <h1>Resume</h1>
    </div>
  );
};
export default Resume;
